import React, { Component } from 'react';
import { Route } from 'react-router';
import { Layout } from './components/Layout';
import { Home } from './components/Home';
import { FetchData } from './components/FetchData';
import { Counter } from './components/Counter';
import { FetchProfil } from './components/profil/FetchProfil';
import { UsersRouter } from './components/users/UsersRouter';
import AuthorizeRoute from './components/api-authorization/AuthorizeRoute';
import ApiAuthorizationRoutes from './components/api-authorization/ApiAuthorizationRoutes';
import { ApplicationPaths } from './components/api-authorization/ApiAuthorizationConstants';


import './custom.css'

export default class App extends Component {
	static displayName = App.name;

	render() {
		return (
			<Layout>
				<AuthorizeRoute path={`/fetchprofil/:userId`} component={FetchData} />
				<Route exact path='/' component={Home} />
				<Route path='/counter' component={Counter} />
				<AuthorizeRoute path='/fetch-data' component={FetchData} />
				<AuthorizeRoute path='/users' component={UsersRouter} />
				<AuthorizeRoute path='/fetchprofil' component={FetchProfil} />
				<Route path={ApplicationPaths.ApiAuthorizationPrefix} component={ApiAuthorizationRoutes} />
			</Layout>
		);
	}
}
